import re

def extract_links(html_content):
    # 使用正则表达式匹配歌曲链接
    pattern = r'<a href="(\/song\?id=\d+)">'
    matches = re.findall(pattern, html_content)

    # 构建完整的链接列表
    base_url = 'https://music.163.com'
    song_links = [base_url + match for match in matches]

    return song_links

